	//1st call native, then JS. Order is important
	[self JSHook_onExitTransitionDidStart];
	JSB_CCNode *proxy = objc_getAssociatedObject(self, &JSB_association_proxy_key);
	if( proxy )
		[proxy onExitTransitionDidStart];
