	JSB_CCSprite *proxy = [[JSB_CCSprite alloc] initWithJSObject:jsobj class:[CCSprite class]];
	[proxy setRealObj:realObj];

	if( realObj ) {
		objc_setAssociatedObject(realObj, &JSB_association_proxy_key, proxy, OBJC_ASSOCIATION_RETAIN);
		[proxy release];
	}

	[self swizzleMethods];

	return jsobj;
}

